g2:c.PROCEDURE.g2:a.TEXT:
upp-button-mouse-tracking-internals (TrackEvent: symbol, Win: class g2-window, Trigger: item-or-value, TrackedItem: item-or-value, X: integer, Y: integer, EventTime: integer, ModKeys: integer)

BtnSelStatus: symbol = the symbol uil-button-selection-status;
Butt: class uil-button;
CaseNo, En: symbol;
CDef: class class-definition;
DTClass: symbol = the symbol UIL-DIALOG-TITLE;
DTTracker: symbol = the symbol _UIL-DIALOG-TITLE-MOUSE-TRACKING-INTERNALS;
Et, TriggerClass: text;
IconPBClass: symbol = the symbol uil-icon-pushbutton; 
NavButtonSelect : symbol = the symbol uil-select-navigation-button;
PushbuttonClass: symbol = the symbol uil-text-pushbutton; 
RegButtonSelect: symbol = the symbol uil-select-button;
UildefsLoaded: truth-value = false;
UTxt: class uil-text;
DEBUG: truth-value = false;
DEBUG2: truth-value = false;

begin 

if (DEBUG) then
    post "Running upp-button-mouse-tracking-internals: <[TrackEvent]>";

if Trigger does not exist or TrackedItem does not exist then 
  return;

{--- Special tracking for dialog titles ---}
CDef = the class-definition named by the class of Trigger;
if DTClass is a member of the class-inheritance-path of CDef then begin
    start the procedure named by DTTracker (TrackEvent, Win, Trigger, TrackedItem, X, Y, EventTime, ModKeys);
    return;
end;

if (the object-definition named by PushbuttonClass exists and the object-definition named by IconPBClass exists) then 
    UildefsLoaded = true;


{-- ABORT TRACKING --}
if TrackEvent = the symbol ABORT-TRACKING then begin
       if DEBUG then
        post "In ABORT-TRACKING processing"; 
    if (Trigger is a uil-text) and (the uil-button Butt that is the-uil-button-owning-this-text-label Trigger exists) and (Trigger is the same object as TrackedItem or the uil-button that is the-uil-button-owning-this-text-label Trigger is the same object as TrackedItem) then begin
        call upp-raise-button (Butt, TrackEvent); 
        call upp-dismiss-short-description-on-window (Butt, Win); 
    end else if Trigger is a uil-button and (Trigger is the same object as TrackedItem or TrackedItem is a uil-text and the uil-button Butt that is the-uil-button-owning-this-text-label TrackedItem exists and the uil-button that is the-uil-button-owning-this-text-label TrackedItem is the same object as Trigger) then begin 
            call upp-raise-button (Trigger, TrackEvent); 
            call upp-dismiss-short-description-on-window (Trigger, Win); 
    end;
    return;
end;    {-- End of Event: ABORT-TRACKING --} 

{-- ENTER --}
if TrackEvent = the symbol ENTER then begin
    if DEBUG then
        post "In ENTER processing";
    if TrackedItem is not an item then
        return;
    if (the state of Trigger exists and the state of Trigger = the symbol DISABLED) then begin
        if (DEBUG) then
            post "Trigger exists but is disabled, returning";
        return;
    end;
    if (the state of TrackedItem exists and the state of TrackedItem  = the symbol DISABLED) then begin
        if (DEBUG) then
            post "TrackedItem exists but is disabled, returning";
        if (Trigger is a uil-button) then begin
            call upp-raise-button (Trigger, TrackEvent);
            call upp-dismiss-short-description-on-window (Trigger, Win);
        end else if (Trigger is a uil-text) then begin
            if (the uil-button Butt that is the-uil-button-owning-this-text-label Trigger exists) then begin
                call upp-raise-button (Butt, TrackEvent);
                call upp-dismiss-short-description-on-window (Butt, Win); 
            end;
        end;
        return;
    end;
    if (UildefsLoaded) then begin     
        {-- Block button tracking if the dialog is in the process of launching an edit-session --}
        if (DEBUG) then begin
            if (the item superior to the workspace of Trigger exists and the item superior to the workspace of Trigger is a uil-dialog) then
                post "Trigger dialog status: <[the uil-dialog-status of the uil-dialog superior to the workspace of Trigger]>";
            if (the item superior to the workspace of TrackedItem exists and the item superior to the workspace of TrackedItem is a uil-dialog) then
                post "TrackedItem dialog status: <[the uil-dialog-status of the uil-dialog superior to the workspace of TrackedItem]>"; 
        end;

        if (the item superior to the workspace of Trigger exists and the item superior to the workspace of Trigger is a uil-dialog and (the uil-dialog-status of the uil-dialog superior to the workspace of Trigger /= the symbol EDIT-SESSION-IN-PROGRESS and the uil-dialog-status of the uil-dialog superior to the workspace of Trigger /= the symbol NO-EDIT-SESSION-IN-PROGRESS-USER-DISABLED)) then begin
            if (DEBUG2) then
                post "Trigger mouse-tracking: uil-dialog-status is not edit-session-in-progress <[the uil-dialog-status of the uil-dialog superior to the workspace of Trigger]>, returning";
            return;
        end;

        if (the item superior to the workspace of TrackedItem exists and the item superior to the workspace of TrackedItem is a uil-dialog and (the uil-dialog-status of the uil-dialog superior to the workspace of TrackedItem /= the symbol EDIT-SESSION-IN-PROGRESS and the uil-dialog-status of the uil-dialog superior to the workspace of Trigger /= the symbol NO-EDIT-SESSION-IN-PROGRESS-USER-DISABLED)) then begin
            if (DEBUG2) then
                post "TrackedItem mouse-tracking: uil-dialog-status is not edit-session-in-progress <[the uil-dialog-status of the uil-dialog superior to the workspace of TrackedItem]> , returning"; 
            return;
        end;

        {-- Don't let a selected pushbutton get selected --}
        if ((((Trigger is an instance of the class named by (IconPBClass)) or (Trigger is an instance of the class named by (PushbuttonClass))) and (the item-or-value that is an attribute of Trigger named by BtnSelStatus exists and the item-or-value that is an attribute of Trigger named by BtnSelStatus is selected)) or ((Trigger is a uil-text and there exists a uil-button Butt that is the-uil-button-owning-this-text-label Trigger ) and ((Butt is an instance of the class named by (IconPBClass) or Butt is an instance of the class named by (PushbuttonClass)) and (the item-or-value that is an attribute of Butt named by BtnSelStatus exists and the item-or-value that is an attribute of Butt named by BtnSelStatus is selected)))) then begin
            if (DEBUG) then
                post "leaving upp-button-mouse-tracking, button is already selected";
            return;
        end;
        if (((TrackedItem is an instance of the class named by (IconPBClass) or TrackedItem is an instance of the class named by (PushbuttonClass)) and (the item-or-value that is an attribute of TrackedItem named by BtnSelStatus exists and the item-or-value that is an attribute of TrackedItem named by BtnSelStatus is selected)) or ((TrackedItem is a uil-text and there exists a uil-button Butt that is the-uil-button-owning-this-text-label TrackedItem) and ((Butt is an instance of the class named by (IconPBClass) or Butt is an instance of the class named by (PushbuttonClass)) and (the item-or-value that is an attribute of Butt named by BtnSelStatus exists and the item-or-value that is an attribute of Butt named by BtnSelStatus is selected)))) then begin
            if (DEBUG) then
                post "leaving upp-button-mouse-tracking, button is already selected"; 
            return;
        end;     
    end;

    {-- Check for an edit-box that is in the process of launching an editor, but for which the field-mask has not yet been created --}

{-- Case 0 -- entering something other than a button or its label. Resetting. --}
    if Trigger is a uil-button and (TrackedItem is not a uil-button and TrackedItem is not a uil-text) then begin
        if DEBUG then
            post "1. Event:>[TrackEvent] / [(if Trigger exists then "[the class of Trigger]" else "")]  /  [(if TrackedItem exists then "[the class of TrackedItem]" else "")]";
        call upp-raise-button (Trigger, TrackEvent);
        call upp-dismiss-short-description-on-window (Trigger, Win);
    end else if Trigger is a uil-text and the uil-button Butt that is the-uil-button-owning-this-text-label Trigger exists and (TrackedItem is not a uil-button and TrackedItem is not a uil-text) then begin
        if DEBUG then
            post "2. Event:>[TrackEvent] / [(if Trigger exists then "[the class of Trigger]" else "")]  /  [(if TrackedItem exists then "[the class of TrackedItem]" else "")]"; 
        call upp-raise-button (Butt, TrackEvent); 
        call upp-dismiss-short-description-on-window (Butt, Win); 
    end else
{-- Case 1 -- Initial entry is a uil-button. --}
    if Trigger is a uil-button and Trigger is the same object as TrackedItem then begin
        if DEBUG then
            post "3. Event:>[TrackEvent] / [(if Trigger exists then "[the class of Trigger]" else "")]  /  [(if TrackedItem exists then "[the class of TrackedItem]" else "")]";
        call upp-lower-button (Trigger, TrackEvent);
        call upp-post-short-description-on-window (Trigger, Win);
    end else if Trigger is a uil-button and there exists a uil-text that is the-uil-text-label-of Trigger and the uil-text that is the-uil-text-label-of Trigger is the same object as TrackedItem then begin
        if DEBUG then
            post "4. Event:>[TrackEvent] / [(if Trigger exists then "[the class of Trigger]" else "")]  /  [(if TrackedItem exists then "[the class of TrackedItem]" else "")]";
        call upp-lower-button (Trigger, TrackEvent);
        call upp-post-short-description-on-window (Trigger, Win); 
    end else if Trigger is a uil-text and there exists a uil-button Butt that is the-uil-button-owning-this-text-label Trigger and the uil-button that is the-uil-button-owning-this-text-label Trigger is the same object as TrackedItem then begin
        if DEBUG then
            post "5. Event:>[TrackEvent] / [(if Trigger exists then "[the class of Trigger]" else "")]  /  [(if TrackedItem exists then "[the class of TrackedItem]" else "")]";
        call upp-lower-button (Butt, TrackEvent);
        call upp-post-short-description-on-window (Butt, Win); 
    end else if Trigger is a uil-text and there exists a uil-button Butt that is the-uil-button-owning-this-text-label Trigger and Trigger is the same object as TrackedItem then begin
        if DEBUG then
            post "6. Event:>[TrackEvent] / [(if Trigger exists then "[the class of Trigger]" else "")]  /  [(if TrackedItem exists then "[the class of TrackedItem]" else "")]";
        call upp-lower-button (Butt, TrackEvent);
        call upp-post-short-description-on-window (Butt, Win); 
    end else
{-- Case 2 -- Initial entry is a text label of a uil-button --}
    if Trigger is a uil-text and there exists a uil-button Butt that is the-uil-button-owning-this-text-label Trigger and Trigger is the same object as TrackedItem then begin 
        if DEBUG then
            post "7. Event:>[TrackEvent] / [(if Trigger exists then "[the class of Trigger]" else "")]  /  [(if TrackedItem exists then "[the class of TrackedItem]" else "")]";
        call upp-lower-button (Butt, TrackEvent);
        call upp-post-short-description-on-window (Butt, Win); 
    end else
{-- Case 3 -- Entering something else; i.e. reset the button. --}
    if Trigger is a uil-button then begin
        if DEBUG then
            post "8. Event:>[TrackEvent] / [(if Trigger exists then "[the class of Trigger]" else "")]  /  [(if TrackedItem exists then "[the class of TrackedItem]" else "")]";
        call upp-raise-button (Trigger, TrackEvent);
        call upp-dismiss-short-description-on-window (Trigger, Win); 
    end else if Trigger is a uil-text and the uil-button Butt that is the-uil-button-owning-this-text-label Trigger exists then begin
        if DEBUG then
            post "9. Event:>[TrackEvent] / [(if Trigger exists then "[the class of Trigger]" else "")]  /  [(if TrackedItem exists then "[the class of TrackedItem]" else "")]";
        call upp-raise-button (Butt, TrackEvent);
        call upp-dismiss-short-description-on-window (Butt, Win); 
    end else       
        return;
end;  {-- End of Event: ENTER tracking --}

{-- STOP-TRACKING --}
if TrackEvent = the symbol STOP-TRACKING then begin
    if DEBUG then
        post "In STOP-TRACKING processing"; 
    if TrackedItem is not an item or Trigger is not an item then 
        return; 
    if (the state of Trigger exists and the state of Trigger = the symbol DISABLED) then
        return;
    if (the state of TrackedItem exists and the state of TrackedItem = the symbol DISABLED) then
        return;
    if (UildefsLoaded) then begin
        if (((Trigger is an instance of the class named by (IconPBClass) or Trigger is an instance of the class named by (PushbuttonClass)) and (the item-or-value that is an attribute of Trigger named by BtnSelStatus exists and the item-or-value that is an attribute of Trigger named by BtnSelStatus is selected)) or ((Trigger is a uil-text and there exists a uil-button Butt that is the-uil-button-owning-this-text-label Trigger) and ((Butt is an instance of the class named by (IconPBClass) or Butt is an instance of the class named by (PushbuttonClass)) and (the item-or-value that is an attribute of Butt named by BtnSelStatus exists and the item-or-value that is an attribute of Butt named by BtnSelStatus is selected)))) then
            return;
        if (((TrackedItem is an instance of the class named by (IconPBClass) or TrackedItem is an instance of the class named by (PushbuttonClass)) and (the item-or-value that is an attribute of TrackedItem named by BtnSelStatus exists and the item-or-value that is an attribute of TrackedItem named by BtnSelStatus is selected)) or ((TrackedItem is a uil-text and there exists a uil-button Butt that is the-uil-button-owning-this-text-label TrackedItem) and ((Butt is an instance of the class named by (IconPBClass) or Butt is an instance of the class named by (PushbuttonClass)) and (the item-or-value that is an attribute of Butt named by BtnSelStatus exists and the item-or-value that is an attribute of Butt named by BtnSelStatus is selected)))) then
            return; 
    end;

    if Trigger is a uil-button and Trigger is the same object as TrackedItem then begin
       if DEBUG then
            post "11. Event:>[TrackEvent] / [(if Trigger exists then "[the class of Trigger]" else "")]  /  [(if TrackedItem exists then "[the class of TrackedItem]" else "")]"; 
        if Trigger is a uil-navigation-button then
            call uil-select-navigation-button (Trigger, Win, the workspace of Trigger)
        else begin
            if (UildefsLoaded) and (Trigger is an instance of the class named by (IconPBClass) or Trigger is an instance of the class named by (PushbuttonClass)) then begin
                if (the item-or-value that is an attribute of Trigger named by BtnSelStatus exists and the item-or-value that is an attribute of Trigger named by BtnSelStatus = the symbol UNSELECTED) then 
                    call the procedure named by RegButtonSelect (Trigger, Win, the workspace of Trigger); 
            end else
                call the procedure named by RegButtonSelect (Trigger, Win, the workspace of Trigger); 
        end;

        if Trigger is a uil-navigation-button or ((UildefsLoaded) and (Trigger is an instance of the class named by (PushbuttonClass) or Trigger is an instance of the class named by (IconPBClass))) then
            call upp-raise-button (Trigger, TrackEvent); 
        call upp-dismiss-short-description-on-window (Trigger, Win);
    end else if Trigger is a uil-button and (TrackedItem is a uil-text and the uil-text UTxt that is the-uil-text-label-of Trigger exists and UTxt is the same object as TrackedItem) then begin

        if DEBUG then
            post "12. Event:>[TrackEvent] / [(if Trigger exists then "[the class of Trigger]" else "")]  /  [(if TrackedItem exists then "[the class of TrackedItem]" else "")]"; 

        if Trigger is a uil-navigation-button then
            call uil-select-navigation-button (Trigger, Win, the workspace of Trigger)
        else begin
            if (UildefsLoaded) and (Trigger is an instance of the class named by (IconPBClass) or Trigger is an instance of the class named by (PushbuttonClass)) then begin
                if (the item-or-value that is an attribute of Trigger named by BtnSelStatus exists and the item-or-value that is an attribute of Trigger named by BtnSelStatus = the symbol UNSELECTED) then
                    call the procedure named by RegButtonSelect (Trigger, Win, the workspace of Trigger); 
            end else
                call the procedure named by RegButtonSelect (Trigger, Win, the workspace of Trigger); 
        end;

        if Trigger is a uil-navigation-button or ((UildefsLoaded) and (Trigger is an instance of the class named by (PushbuttonClass) or Trigger is an instance of the class named by (IconPBClass))) then 
            call upp-raise-button (Trigger, TrackEvent); 
        call upp-dismiss-short-description-on-window (Trigger, Win); 
    end else if Trigger is a uil-text and the uil-button that is the-uil-button-owning-this-text-label Trigger exists and ((Trigger is the same object as TrackedItem) or (the item that is the-uil-text-label-of TrackedItem exists and Trigger is the same object as the item that is the-uil-text-label-of TrackedItem)) then begin
        if DEBUG then
            post "13. Event:>[TrackEvent] / [(if Trigger exists then "[the class of Trigger]" else "")]  /  [(if TrackedItem exists then "[the class of TrackedItem]" else "")]";
        Butt = the uil-button that is the-uil-button-owning-this-text-label Trigger;
        if Butt is a uil-navigation-button then
            call uil-select-navigation-button (Butt, Win, the workspace of Butt)
        else begin
            if (UildefsLoaded) and (Butt is an instance of the class named by (IconPBClass) or Butt is an instance of the class named by (PushbuttonClass)) then begin
                if (the item-or-value that is an attribute of Butt named by BtnSelStatus exists and the item-or-value that is an attribute of Butt named by BtnSelStatus = the symbol UNSELECTED) then 
                    call the procedure named by RegButtonSelect (Butt, Win, the workspace of Butt); 
            end else            
                call the procedure named by RegButtonSelect (Butt, Win, the workspace of Butt); 
        end;

        {### if (Trigger is a uil-navigation-button or Trigger is a uil-text-pushbutton or Trigger is a uil-icon-pushbutton) then 
            call upp-raise-button (Trigger, TrackEvent); ###}

        if (Butt is a uil-navigation-button or ((UildefsLoaded) and (Butt is an instance of the class named by (PushbuttonClass) or Butt is an instance of the class named by (IconPBClass)))) then 
            call upp-raise-button (Butt , TrackEvent); 
        call upp-dismiss-short-description-on-window (Butt, Win); 
    end else if Trigger is a uil-button then begin
        if DEBUG then
            post "14. Event:>[TrackEvent] / [(if Trigger exists then "[the class of Trigger]" else "")]  /  [(if TrackedItem exists then "[the class of TrackedItem]" else "")]";
        call upp-raise-button (Trigger, TrackEvent); 
        call upp-dismiss-short-description-on-window (Trigger, Win); 
    end else if the uil-button Butt that is the-uil-button-owning-this-text-label Trigger exists then begin
        if DEBUG then
            post "15. Event:>[TrackEvent] / [(if Trigger exists then "[the class of Trigger]" else "")]  /  [(if TrackedItem exists then "[the class of TrackedItem]" else "")]";
        call upp-raise-button (Butt, TrackEvent);
        call upp-dismiss-short-description-on-window (Butt, Win); 
    end;
end;

end 
on error (En, Et)
end

upp-make-navigation-button (Template : class uil-navigation-button-template)

Btn: class uil-button;
Wksp, BSWS, TSWS: class kb-workspace;
P: class guide-garbage-pail;
Delete: truth-value = false;
X, Y: integer;

begin

Wksp = the workspace of Template;
if there exists a guide-garbage-pail P upon Wksp and Template is not the same object as P then 
    Delete = call guide-is-contained-in (Template, P);

if Delete then begin
    make Template transient;
    delete Template;
    return;
end;
case (the class of Template) of
    uil-help-button-template: 
        Btn = call uil-create-navigation-button ("", the symbol HELP, the symbol NONE); 
    uil-hide-button-template: 
        Btn = call uil-create-navigation-button ("", the symbol HIDE, the symbol NONE); 
    uil-goto-previous-button-template: 
        Btn = call uil-create-navigation-button ("", the symbol GOTO-PREVIOUS, the symbol UIL-DEST); 
    uil-goto-next-button-template: 
        Btn = call uil-create-navigation-button("", the symbol GOTO-NEXT, the symbol UIL-DEST); 
    uil-goto-superior-button-template: 
        Btn = call uil-create-navigation-button("", the symbol GOTO-SUPERIOR, the symbol GUIDE-NAVIGATION-HELP); 
    uil-goto-workspace-button-template: begin 
        Btn = call uil-create-navigation-button ("", the symbol GOTO-WORKSPACE, the symbol NONE);
        {*** In case the template & the subworkspace were made while G2 was paused ***}
        if the subworkspace TSWS of Template exists then begin
            BSWS = the subworkspace of Btn;
            make BSWS transient;
            delete BSWS;
            make TSWS transient;
            make TSWS the subworkspace of Btn;
        end;
    end;         
    otherwise : begin end;
end;
    
X = the item-x-position of Template;
Y = the item-y-position of Template;
transfer Btn to wksp at (X, Y);
conclude that the uil-is-managed of Btn = 1;
conclude that the uil-is-permanent of Btn is true;
if (uil-use-icon-text-for-button-labels) then
    conclude that the uil-label-id of Btn = "5.0";
make Btn permanent;

make Template transient;
delete Template;

end

upp-process-mouse-button-event (event: symbol, window: class ui-client-item, triggerItem: item-or-value, trackedItem: item-or-value, mouseX: integer, mouseY: integer, timeStamp: integer, modifierKeys: integer) = (symbol)
IList: class item-list = uil-item-last-clicked-on;
TimeDif: quantity;
ButtonEvent: symbol = the symbol unknown;
DEBUG: truth-value = false;
begin
    if (window is not a g2-window) then return the symbol UNSUPPORTED-CLIENT;
{--
Modifier Keys:
           
    Alt     Control     Shift    Value
--------------------------------------------------
    Up        Up        Up         0
    Up        Up        Down     1
    Up        Down    Up         2
    Up        Down    Down     3
    Down    Up        Up         4
    Down    Up        Down     5
    Down    Down    Up         6
    Down    Down    Down      7
--}
    ButtonEvent = event;

{-- START-TRACKING --}
    if (event = the symbol START-TRACKING) then
        begin
        if (DEBUG) then
            inform the operator that "*** START-TRACKING => TriggerItem: [the class of triggerItem] trackedItem: [the class of trackedItem]  ([mouseX], [mouseY])"; 
        if (the number of elements in IList >= 1) and (triggerItem is the same object as the first item in IList) then
            begin
            TimeDif = timeStamp - uil-timestamp-of-last-click;
            if (TimeDif < uil-single-click-duration) then
                ButtonEvent = the symbol double-click
            else
                begin
                ButtonEvent = the symbol single-click;
                conclude that uil-timestamp-of-last-click = timeStamp; 
                end;
            end
        else
            begin
            ButtonEvent = the symbol single-click;
            remove the first item from IList;
            insert triggerItem at the beginning of IList;
            conclude that uil-timestamp-of-last-click = timeStamp;
            end;
        end

{-- ENTER --}
    else if (event = the symbol ENTER) then
        begin
        if (DEBUG) then
            inform the operator that "*** ENTER => TriggerItem: [the class of TriggerItem]  TrackedItem: [the class of TrackedItem]";
        end

{-- MOTION --}
    else if (event = the symbol MOTION) then
        begin
        if (trackedItem exists and trackedItem is an item) then
            begin          
{--
            if (DEBUG) then
                inform the operator that "*** MOTION => TriggerItem: [the class of TriggerItem]  TrackedItem: [the class of TrackedItem]  ([mouseX], [mouseY]) "; 
--}
            end;
        end

{-- LEAVE --}
    else if (event = the symbol LEAVE) then
        begin
        if (DEBUG) then
            inform the operator that "*** LEAVE => TriggerItem: [the class of TriggerItem]  TrackedItem: [the class of TrackedItem]"; 
        end

{-- STOP-TRACKING --}
    else if (event = the symbol STOP-TRACKING) then
        begin
        if (DEBUG) then
            inform the operator that "*** STOP-TRACKING => TriggerItem: [the class of TriggerItem]  TrackedItem: [the class of TrackedItem]  ([mouseX], [mouseY])"; 
        end

{-- ABORT-TRACKING --}
    else if (event = the symbol ABORT-TRACKING) then
        begin
        end;

{-- Return Event Information --}
    return ButtonEvent;
end

uil-convert-buttons-from-4.1-to-5.0 ()
    B: class uil-button;
    total-count: integer = 0;
    current-count: integer = 0;
begin
    for B = each uil-button do
        if (remainder (total-count, 20) = 0) and (total-count > 0) then
            allow other processing;
        total-count = total-count + 1;
        end;
    inform the operator that "Converting [total-count] buttons to 5.0 format. . .";
    for B = each uil-button do
         current-count = current-count + 1;
         if (remainder (current-count, 100) = 0) and (current-count > 0) then
            inform the operator that "Finished converting [current-count] out of [total-count] buttons.";
        if (the uil-label-id of B /= "5.0") then
            call uil-convert-button-from-4.1-to-5.0 (B);
        end;
    inform the operator that "Done converting buttons.";
end

upp-convert-navigation-button-from-4.1-to-5.0 (B: class uil-navigation-button)
    other-conversion-proc: symbol = the symbol upp-convert-button-from-4.1-to-5.0;
    DEBUG: truth-value = false;
begin 
    if (the procedure named by other-conversion-proc exists) then
        begin
        call the procedure named by other-conversion-proc (B);
        return;
        end;

    if (DEBUG) then
        inform the operator that "Running upp-convert-navigation-button-from-4.1-to-5.0";

    if (the uil-button-label-color icon-color of B does not exist) then
        return; 
    if (the uil-label-id of B exists) then
        conclude that the uil-label-id of B = "5.0"; 

    call upp-set-button-label (B, the label of B);
end

upp-get-text-extent (
    text: text,
   text-box-subclass: symbol {text-box subclass, i.e., statement, message, etc.; real 
                                class type checking done on the Lisp side} 
  )
= (structure)
 {

Copy this from g2-get-text-extent!
It has to be here because of modularization problems -- it's needed in uilroot, but the system procedure is defined in sys-mod, which in turn requires uilroot.

(1) width in x of the bounding box of the text;
(2) height in y of the bounding box of the text;
(3) the width of the left margin;
(4) the width of the top margin;
(5) the width of the right margin;
(6) the width of the bottom margin;
(7) the width of the left border;
(8) the width of the top border;
(9) the width of the right border;
(10) the width of the bottom border
}
x: structure;
begin
    x = system call G2-get-text-extent
            (text, text-box-subclass);
    return x
end

g2:c.METHOD.g2:a.TEXT:
upp-set-button-label (B: class uil-navigation-button, T: text)
    Size, FontSize: symbol;
    W, H, IconSize: integer;
    DEBUG: truth-value = false;
begin
if (DEBUG) then
    inform the operator that "running upp-set-button-label for: [the class of B]";
    if (T = "") then
        begin
        {-- This has the side effect of resetting width and height to their default values. --}
        conclude that the icon-variables of B = evaluated-structure (
                the symbol uil-button-label-value, "");
        return;
        end;

    FontSize = the uil-label-size of B; 
    W, H = call uil-get-text-extent (T, FontSize); 
 
    if (FontSize = the symbol medium) or (FontSize = the symbol unspecified) then
        FontSize = the symbol large
    else if (FontSize = the symbol small) then
        FontSize = the symbol small
    else if (FontSize = the symbol large) then
        FontSize = the symbol extra-large
    else
        return;

    conclude that the icon-variables of B = evaluated-structure (
            the symbol uil-button-label-value, T,
            the symbol uil-button-label-font-size, FontSize, 
            the symbol uil-button-label-x-position, 32, 
            the symbol uil-button-label-y-position, 20,
            the symbol width, 32 + W,
            the symbol height, max (25, H)); 
end

g2:c.PROCEDURE.g2:a.TEXT:
uil-get-text-extent (String: text, FS: symbol) = (integer, integer)
    W: integer;  {first return value}
    H: integer;   {second return value}
    extent-info-struct: structure;
    TXT: class uil-text; 
    tmp1, tmp2: quantity; 
    DEBUG: truth-value = false;
begin
    {-- This procedure should use GUIDE's font-sizing conventions, e.g. small / medium / large, not G2's. --}

    if (DEBUG) then
        inform the operator that "Running uil-get-text-extent on @"[String]@"";


    if (FS = the symbol small) then
        begin
        extent-info-struct = call upp-get-text-extent (String, the symbol upp-small-font-measure);
        w = the width of extent-info-struct;
        h = the height of extent-info-struct;
        end

    else if (FS = the symbol medium) or (FS = the symbol unspecified) then
        begin
        extent-info-struct = call upp-get-text-extent (String, the symbol upp-medium-font-measure);
        w = truncate (1.02 * the width of extent-info-struct);
        h = the height of extent-info-struct; 
        end

    else if (FS = the symbol large) or (FS = the symbol extra-large) then
        begin
        extent-info-struct = call upp-get-text-extent (String, the symbol upp-large-font-measure);
        {fudge factors to correct for a G2 bug}
        w = truncate (1.05 * the width of extent-info-struct);
        h = truncate(0.9 * the height of extent-info-struct);
        end
    else
        begin
        inform the operator that "Bad font-size argument [FS] to uil-get-text-extent!  Should be one of:  small, medium, large, extra-large, or unspecified";
        w = 0;
        h = 0;
        end;

    return w, h;
end

g2:c.METHOD.g2:a.TEXT:
upp-set-button-label (B: class uil-icon-button, T: text)
    Size, FontSize: symbol;
    W, H, IconSize: integer;
    Baseline-depth: integer;
    Y-position: integer;
    Height: integer;
    en: symbol; et: text;
    DEBUG: truth-value = false;
begin
    if (T = "") then
        begin
        {-- This has the side effect of resetting width and height to their default values. --}
        conclude that the icon-variables of B = evaluated-structure (
                the symbol uil-button-label-value, "");
        return;
        end;

    FontSize = the uil-label-size of B; 
    W, H = call uil-get-text-extent (T, FontSize);
    Baseline-depth = baseline-depth-for-font-size (FontSize);

    if (FontSize = the symbol small) then
        FontSize = the symbol small
    else if (FontSize = the symbol medium) or (FontSize = the symbol unspecified) then
        FontSize = the symbol large
    else if (FontSize = the symbol large) then
        FontSize = the symbol extra-large
    else
        return;
    
    Size = the uil-size of B; 
    if (Size = the symbol small) then
        IconSize = 16
    else if (Size = the symbol medium) or (Size = the symbol unspecified) then
        IconSize = 20
    else if (Size = the symbol large) then
        IconSize = 25
    else
        return;
        
    if (Baseline-depth > IconSize) then
        y-position = Baseline-depth
    else
        y-position = IconSize - floor ((IconSize - Baseline-depth) / 2);
    {inform the operator that "Baseline depth = [Baseline-depth], icon size = [IconSize], y-position = [y-position]";}

    conclude that the icon-variables of B = evaluated-structure (
            the symbol uil-button-label-value, T,
            the symbol uil-button-label-font-size, FontSize, 
            the symbol uil-button-label-x-position, IconSize + 6, 
           {the symbol uil-button-label-y-position, IconSize - (floor (IconSize / 4)) + (floor ((H - IconSize) / 2)),} {there's no special meaning in this formula; it just seemed to work}
            the symbol uil-button-label-y-position, y-position,
            the symbol uil-button-size, IconSize,
            the symbol width, IconSize + 10 + W,
            the symbol height, max(IconSize, H + (y-position - Baseline-depth)));
            {the symbol height, max(IconSize, H + 1));}
end 
on error (en, et)
    if (DEBUG) then
        inform the operator that "[et]";
end

upp-update-button-label (B: class uil-button)
    LeadB, T: item-or-value; 
    uil-update-button-label-proc: symbol = the symbol uil-update-button-label;
    uil-get-selection-box-lead-button-proc: symbol = the symbol uil-get-selection-box-lead-button;
    upp-manage-horizontal-selection-buttons-proc: symbol = the symbol upp-manage-horizontal-selection-buttons;
    upp-resize-selection-box-to-frame-buttons-proc: symbol = the symbol upp-resize-selection-box-to-frame-buttons;
    DEBUG: truth-value = false;
begin
if (DEBUG) then
    inform the operator that "Running upp-update-button-label for [the class of B]";

    if (the uil-label-id of B exists and the uil-label-id of B = "5.0") then
        begin
        if (the label of B exists) then
            call upp-set-button-label (B, the label of B);
        if (the procedure named by uil-get-selection-box-lead-button-proc exists) and (B is a uil-selection-button) and (the uil-button-orientation of the uil-selection-box that is the-group-master-of B = the symbol horizontal) then
            begin
            LeadB = call the procedure named by uil-get-selection-box-lead-button-proc (the uil-selection-box that is the-group-master-of B);
            call the procedure named by upp-manage-horizontal-selection-buttons-proc (the uil-selection-box that is the-group-master-of B, the workspace of the uil-selection-box that is the-group-master-of B, the item-x-position of LeadB, the item-y-position of LeadB);
            call the procedure named by upp-resize-selection-box-to-frame-buttons-proc (the uil-selection-box that is the-group-master-of B);
            end;
        end
    else
        begin
        T = call uil-get-label-text (B); 
        if (T exists and T is a uil-text) then
            begin
            {this procedure is in the uillib module, but maybe only uilroot is loaded}
            if (the procedure named by uil-update-button-label-proc exists) then
                call the procedure named by uil-update-button-label-proc (B);
            end
        end;
end

g2:c.PROCEDURE.g2:a.TEXT:
uil-get-label-text (B: class item) = (item-or-value)
WS: class kb-workspace;
T: item-or-value;
DEBUG: truth-value = false;
begin
{-- First check for uil-label-id. If it doesn't exists, then use the old mechanism of the uil-text-relation --}
if (DEBUG) then
    inform the operator that "Running uil-get-label-text: uil-label-id: <[the uil-label-id of B]>";

    if (the uil-label-id of B exists) and (the uil-label-id of B = "5.0") then
        return the symbol not-found;

    if (the uil-label-id of B exists and the uil-label-id of B /= "") then
        begin
        if (the workspace of B exists) then
            begin
            WS = the workspace of B;   {The 'there exists' check may be slowing this down.}
            if (there exists a uil-text T upon WS such that ({the uil-label-id of T exists and} the uil-label-id of T = "[the uil-label-id of B]")) then
                return T;
            end;
       
        if (there exists a uil-text T such that ({the uil-label-id of T exists and} the uil-label-id of T = "[the uil-label-id of B]")) then
            return T;
        end;

    if (DEBUG) then
        inform the operator that "use the old mechanism of uil-text-relation: uil-text-relation <[the uil-text-relation of B]>  label: <[the label of B]>";

    if (the uil-text-relation of B exists and the uil-text named by the uil-text-relation of B exists) then
        begin
        if (DEBUG) then
            inform the operator that "returning the text-label using the uil-text-relation mechanism";

        return the uil-text named by the uil-text-relation of B;
        end
    else
        begin
        if (DEBUG) then
            inform the operator that "Returning the symbol not-found";

        return the symbol not-found;
        end;

    {if (the uil-text that is the-uil-text-label-of B exists) then
        return the uil-text that is the-uil-text-label-of B
    else
        return the symbol not-found;}
end

upp-get-workspace-button-configuration (G: class item) = (item-or-value)
ReturnValue: item-or-value;
en: symbol; et: text;
begin
    ReturnValue = the symbol configuration-not-found;

    if (G is a uil-workspace-button) then 
        begin
        if (the configuration of G exists and the uil-navigation-button-configuration-class named by the configuration of G exists) then
            ReturnValue = the uil-navigation-button-configuration-class named by the configuration of G

        else if uil-navigation-button-configuration exists then
            ReturnValue = uil-workspace-button-configuration;
        end;

    return ReturnValue;
end

upp-select-workspace-button (B: class uil-button, W: class item, drawable: class item)
dlg-or-wksp: class item;
en: symbol; et: text;
uil-highlight-button-proc: symbol = the symbol uil-highlight-button;
uil-reset-button-proc: symbol = the symbol upp-reset-button-internals;
DEBUG: truth-value = false;
begin
if (DEBUG) then
    inform the operator that "Running uil-select-workspace-button.";

    if (B exists) then
        begin
        {show the workspace of B on W;  user didn't want this}
        if the procedure named by uil-highlight-button-proc exists then
            call the procedure named by uil-highlight-button-proc (B); 
        
        if (the procedure named by the uil-handler-method of B exists) then
            begin
            if (the uil-release-button-after-selection of B exists and the uil-release-button-after-selection of B is true) then
                start the procedure named by the uil-handler-method of B (B, W, drawable)
            else
                 call the procedure named by the uil-handler-method of B (B, W, drawable);
            end;

        if the procedure named by uil-reset-button-proc exists then
            call the procedure named by uil-reset-button-proc (B);
        end;
end  
on error (en, et)
    if the procedure named by uil-reset-button-proc exists then
        call the procedure named by uil-reset-button-proc (B);
end

upp-move-button (button: item-or-value, Reposition: truth-value) 
wksp: class kb-workspace;
LeadB: class uil-selection-button;
BOX: class uil-selection-box;
S: symbol;
lineup-proc: symbol = the symbol upp-lineup-selection-buttons;
reposition-related-text-proc: symbol = the symbol upp-reposition-related-text-for-button;
check-for-button-repositioning-proc: symbol = the symbol upp-check-for-button-repositioning;
drop-item-behind: symbol = the symbol g2-drop-item-behind;
drop-item-to-bottom: symbol = the symbol g2-drop-item-to-bottom;
move-related-border-proc : symbol = the symbol uil-move-related-border;
text-button-class: symbol = the symbol uil-text-button;
trash-it: truth-value = false;
button-deleted: truth-value = false;
Txt : item-or-value;
DEBUG: truth-value = false;
begin 
    if not (button exists and button is a uil-button) then
        return;

if (DEBUG) then
    inform the operator that "Running upp-move-button. button is: [the label of button]";

    wksp = the workspace of button;

    if button is a uil-navigation-button then 
      begin
      end

    else if button is a uil-selection-button then
        begin
        {--- Check to see if the user is trying to reposition the button within its siblings ---}
        if (Reposition) and (the procedure named by check-for-button-repositioning-proc exists) then 
            call the procedure named by check-for-button-repositioning-proc (button);
       
        {--- If the lead button was moved, then force all other buttons in the selection-box to line up with it ---}
        if (the item that is the-group-master-of button exists) and (the procedure named by lineup-proc exists) then
            begin
            call the procedure named by lineup-proc (button);
            end; 
        end;
   
    {--- If the button has a text-relation, move the related text to be near the button ---}
    if the procedure named by reposition-related-text-proc exists then 
        call the procedure named by reposition-related-text-proc (button);

    if (the object-definition named by text-button-class exists) and (button is an instance of the class named by (text-button-class)) then
        begin
        if (the uil-text that is the-uil-text-label-of button exists) then
            begin
            if (DEBUG) then
                inform the operator that "drop-item-behind";
            call the procedure named by drop-item-behind (button, the uil-text that is the-uil-text-label-of button)
            end
        else
            begin
            if (DEBUG) then
                inform the operator that "drop-item-to-bottom";
            call the procedure named by drop-item-to-bottom (button);
            end;
        end;
 
    {--- Check if a button is moved over a garbage-pail.  guide-check-for-trash returns true if it deleted the button. ---}
    S = the symbol guide-check-for-trash;
    if (the procedure named by S exists) then
        begin 
        button-deleted = call the procedure named by S (button, wksp);
        end;

    if not (button exists) then 
        return
    else begin
        if the procedure named by move-related-border-proc exists then begin
            Txt = call uil-get-label-text(button);
            if Txt exists and Txt is an item then
                start the procedure named by move-related-border-proc(Txt);
        end;
    end;
end

upp-dismiss-short-description-on-window (B: class object, W : class ui-client-item)
WS : class kb-workspace;

begin
  
if B exists and there exists a kb-workspace WS that is the-mouse-press-state-of B then 
    begin
        delete WS;
    end; 

end

upp-post-short-description-on-window (B: class object, W: class ui-client-item)
WS : class kb-workspace;
T : class uil-text;
XinWin: symbol = the symbol g2-x-in-window;
YinWin: symbol = the symbol g2-y-in-window;
x, y : integer;
begin

if ((the uil-short-description of B exists and the uil-short-description of B /= "") and not (there exists a kb-workspace WS that is the-mouse-press-state-of B)) and (the procedure named by XinWin exists and the procedure named by YinWin exists) then
    begin
        create a kb-workspace WS;
        change the text of the workspace-margin of WS to "0";
        change the text of the frame-style of WS to "uil-default-frame-style";
        change the text of the item-configuration of WS to "configure the user interface as follows:
            unless in administrator or uil-build mode:
              non-menu choices for kb-workspace include: show-workspace;
              menu choices for kb-workspace include: nothing";
        create a uil-small-text T;
        change the text of T to the uil-short-description of B;

{-- Since the following code is in the uildefs module, and this procedure in in uilroot, it was too tangled to remove it so it is being commented out and hacked to make the text look right even though it won't be configurable. --}
      {  conclude that the configuration of T = the symbol uil-short-description-configuration;
        call uil-configure-grobj (T);  }

        change the background-color of T to light-yellow;
        change the text-color of T to black;
        change the border-color of T to black;
        transfer T to WS;
        conclude that WS is the-mouse-press-state-of B;
        change the size of WS to minimum;
        if W is a g2-window then begin 
            if (the procedure named by XinWin exists) then
                x = call the procedure named by XinWin (the item-x-position of B, the workspace of B, W);
            if (the procedure named by YinWin exists) then
                y = call the procedure named by YinWin (the item-y-position of B - truncate (the item-height of B / 2) - truncate (the item-height of T / 2) + 5 , the workspace of B, W);
            show WS on W at (x, y) in the screen;
        end else show WS on W;
    end; 
end

upp-raise-button (button: class object, event : symbol) 
config: item-or-value; 
button-config-procedure: symbol = the symbol uil-get-configuration; 
scroll-config-procedure: symbol = the symbol upp-configure-scroll-area-buttons; 
toggle-button-reset-procedure : symbol = the symbol upp-reset-toggle-button;
TopSAClass: symbol = the symbol uil-top-scroll-arrow; 
BotSAClass: symbol = the symbol uil-bottom-scroll-arrow;
toggle-button-class: symbol = the symbol uil-text-toggle-button;
IconTBClass: symbol = the symbol uil-icon-toggle-button;
rotation-state: symbol;
region-array: class symbol-array;
region: symbol;
has-reversible-region: truth-value = false; 
g2-get-reflection-and-rotation-sysproc: symbol = the symbol g2-get-reflection-and-rotation;
g2-get-item-color-regions-sysproc: symbol = the symbol g2-get-item-color-regions; 
en: symbol; et: text;
DEBUG: truth-value = false; 
begin
if (DEBUG) then
    inform the operator that "Running upp-raise-button. Event=[event]";
    
    if (button does not exist) then
        return;

    if (button is a uil-navigation-button) then
      config = call upp-get-navigation-button-configuration (button)
    else
      config = call the procedure named by button-config-procedure (button);

  if (the object-definition named by TopSAClass exists and button is an instance of the class named by (TopSAClass)) or (the object-definition named by BotSAClass exists and button is an instance of the class named by (BotSAClass)) then 
    call the procedure named by  scroll-config-procedure (button, the symbol highlight)
  else
  if config is an item then 
    begin
    if (button is a uil-selection-button) or
      ((the object-definition named by toggle-button-class exists) and ((button is an instance of the class named by (IconTBClass)) or (button is an instance of the class named by (toggle-button-class)))) then 
        begin 
          if the toggle-state of button is off and (event = the symbol enter or event = the symbol abort-tracking) then
            begin
                change the color-pattern of button so that uil-button-light-color = the uil-button-light-color of config, uil-button-dark-color = the uil-button-dark-color of config; 
                {don't do anything if the toggle button's state is off}
            end;
          end
    else
            begin
            if (the procedure named by g2-get-item-color-regions-sysproc exists) then
                begin
                region-array = call the procedure named by g2-get-item-color-regions-sysproc (button);
                for region = each symbol in region-array do
                    if region = the symbol uil-button-reversible-color then
                        has-reversible-region = true;
                    end;
                delete region-array;
                if has-reversible-region then
                    begin
                    rotation-state = call the procedure named by g2-get-reflection-and-rotation-sysproc (button);
                    case (rotation-state) of 
                        normal:
                            change the color-pattern of button so that uil-button-light-color = the uil-button-light-color of config, uil-button-dark-color = the uil-button-dark-color of config, uil-button-reversible-color = the uil-button-light-color of config;
                        clockwise-90:
                            change the color-pattern of button so that uil-button-light-color = the uil-button-light-color of config, uil-button-dark-color = the uil-button-dark-color of config, uil-button-reversible-color = the uil-button-dark-color of config; 
                        clockwise-180:   {not used yet for tabbed buttons, as of 8-28-96}
                            change the color-pattern of button so that uil-button-light-color = the uil-button-light-color of config, uil-button-dark-color = the uil-button-dark-color of config, uil-button-reversible-color = the uil-button-light-color of config; 
                        clockwise-270:
                            change the color-pattern of button so that uil-button-light-color = the uil-button-dark-color of config, uil-button-dark-color = the uil-button-light-color of config, uil-button-reversible-color = the uil-button-light-color of config; 
                        end;
                    end 
                else  {if not (has-reversible-region)}
                    change the color-pattern of button so that uil-button-light-color = the uil-button-light-color of config, uil-button-dark-color = the uil-button-dark-color of config;
               end
            else  {system-procedure doesn't exist}
               change the color-pattern of button so that uil-button-light-color = the uil-button-light-color of config, uil-button-dark-color = the uil-button-dark-color of config; 
            end;
    end;
end

upp-lower-button (button: class object, event : symbol) 
config: item-or-value;
button-config-procedure: symbol = the symbol uil-get-configuration; 
scroll-config-procedure: symbol = the symbol upp-configure-scroll-area-buttons; 
toggle-button-reset-procedure : symbol = the symbol upp-reset-toggle-button;
TopSAClass: symbol = the symbol uil-top-scroll-arrow;
BotSAClass: symbol = the symbol uil-bottom-scroll-arrow;
rotation-state: symbol;
region-array: class symbol-array;
region: symbol;
has-reversible-region: truth-value = false;
g2-get-reflection-and-rotation-sysproc: symbol = the symbol g2-get-reflection-and-rotation;
g2-get-item-color-regions-sysproc: symbol = the symbol g2-get-item-color-regions; 
en: symbol; et: text;
DEBUG: truth-value = false;
begin 
if (DEBUG) then 
    inform the operator that "Running upp-lower-button.";

    if (button does not exist) then
        return;

    if (button is a uil-navigation-button) then
        config = call upp-get-navigation-button-configuration (button)
    else
        config = call the procedure named by button-config-procedure (button);

        if (the object-definition named by TopSAClass exists and button is an instance of the class named by (TopSAClass)) or (the object-definition named by BotSAClass exists and button is an instance of the class named by (BotSAClass)) then
            call the procedure named by scroll-config-procedure (button, the symbol reset)
        else
            begin
            if (the procedure named by g2-get-item-color-regions-sysproc exists) then
                begin
                region-array = call the procedure named by g2-get-item-color-regions-sysproc (button);
                for region = each symbol in region-array do
                    if region = the symbol uil-button-reversible-color then
                         has-reversible-region = true;
                    end;
                delete region-array;
                if has-reversible-region then
                    begin
                    rotation-state = call the procedure named by g2-get-reflection-and-rotation-sysproc  (button);
                    case (rotation-state) of 
                        normal:
                            change the color-pattern of button so that uil-button-light-color = the uil-button-dark-color of config, uil-button-dark-color = the uil-button-light-color of config, uil-button-reversible-color = the uil-button-dark-color of config;
                        clockwise-90:
                            change the color-pattern of button so that uil-button-light-color = the uil-button-dark-color of config, uil-button-dark-color = the uil-button-light-color of config, uil-button-reversible-color = the uil-button-light-color of config; 
                        clockwise-180:   {not used yet for tabbed buttons, as of 8-28-96}
                            change the color-pattern of button so that uil-button-light-color = the uil-button-dark-color of config, uil-button-dark-color = the uil-button-light-color of config, uil-button-reversible-color = the uil-button-dark-color of config; 
                        clockwise-270:
                            change the color-pattern of button so that uil-button-light-color = the uil-button-light-color of config, uil-button-dark-color = the uil-button-dark-color of config, uil-button-reversible-color = the uil-button-dark-color of config; 
                        end; 
                    end
                else  {if not (has-reversible-region)}
                    change the color-pattern of button so that uil-button-light-color = the uil-button-dark-color of config, uil-button-dark-color = the uil-button-light-color of config; 
                end
            else  {system-procedure doesn't exist}
                change the color-pattern of button so that uil-button-light-color = the uil-button-dark-color of config, uil-button-dark-color = the uil-button-light-color of config; 
        end;

if (DEBUG) then
    inform the operator that "Leaving upp-lower-button";
end 
    on error (en, et)
end

upp-reset-button-internals (button: class uil-button) 
config: item-or-value;
D: class uil-dialog;
DEBUG: truth-value = false;
begin 
    if (DEBUG) then 
        inform the operator that "Running upp-reset-button-internals";

    {-- This is to get the effect of pressing the button exaggerated --}
    if (the item superior to the workspace of button exists and the item superior to the workspace of button is a uil-dialog and the uil-dialog-in-use of the uil-dialog superior to the workspace of button is true) then 
        begin
        D = the item superior to the workspace of button;

        if ((the uil-action-trigger of D = 0 or the uil-action-trigger of D = the symbol none) or (the callback of button exists and the callback of button /= the symbol uil-control-dialog-callback)) then
            go to continue-with-reset;

        repeat
            wait until the uil-action-trigger of D receives a value;
            if (D does not exist) then
                exit if true
            else if (the uil-action-trigger of D = 0) then
                exit if true;
        end;
    {    end
    else
        begin}
        {-- in case the button is not on a dialog or it fails one of the other cases, the button still looks like it is getting pressed. Note that only pushbuttons should encounter a wait. --}
      {  if not (button is a uil-navigation-button) then
            begin
            if button is a uil-text-pushbutton or button is a uil-icon-pushbutton then
                wait for 1 second;   
            end;  }       
        end;

continue-with-reset:
    if (DEBUG) then
        inform the operator that "continue-with-reset button. calling uil-reset-button";

    if (button exists) then
        call uil-reset-button (button); 
end

uil-handle-workspace-button-method (button: class uil-workspace-button, W : class item, item-or-wksp: class item)
wksp: class kb-workspace;
highlight-button-proc: symbol = the symbol uil-highlight-button;
reset-button-proc: symbol = the symbol upp-reset-button-internals;
DEBUG: truth-value = false;
begin 
if (DEBUG) then
    inform the operator that "Running uil-handle-workspace-button-method";

if the procedure named by highlight-button-proc exists then 
    call the procedure named by highlight-button-proc (button);

    if (item-or-wksp is a kb-workspace) then 
        wksp = item-or-wksp
    else
        wksp = the workspace of item-or-wksp;

if (DEBUG) then
    inform the operator that "Wksp = [the class of wksp]";

    if (button is a uil-print-workspace-button) then begin
        if (DEBUG) then
            inform the operator that "Printing the workspace";
       print wksp;
        end;

if the procedure named by reset-button-proc exists then 
    call the procedure named by reset-button-proc (button);

 end

upp-get-navigation-button-configuration (G: class item) = (item-or-value)
ReturnValue: item-or-value;
en: symbol; et: text;
begin
    ReturnValue = the symbol configuration-not-found;

    if (G is a uil-navigation-button) then 
        begin
        if (the configuration of G exists and the uil-navigation-button-configuration-class named by the configuration of G exists) then
            ReturnValue = the uil-navigation-button-configuration-class named by the configuration of G

        else if uil-navigation-button-configuration exists then
            ReturnValue = uil-navigation-button-configuration;
        end;

    return ReturnValue;
end

uil-highlight-button (button: class object) 
config: item-or-value;
button-config-procedure: symbol = the symbol uil-get-configuration;
scroll-area-buttons-configuration-proc: symbol = the symbol upp-configure-scroll-area-buttons;
TopSAClass: symbol = the symbol uil-top-scroll-arrow;
BotSAClass: symbol = the symbol uil-bottom-scroll-arrow;
rotation-state: symbol;
region-array: class symbol-array;
region: symbol;
has-reversible-region: truth-value = false; 
g2-get-reflection-and-rotation-sysproc: symbol = the symbol g2-get-reflection-and-rotation;
g2-get-item-color-regions-sysproc: symbol = the symbol g2-get-item-color-regions;
g2-work-on-drawing-sysproc: symbol = the symbol g2-work-on-drawing;
DEBUG: truth-value = false;
begin
if (DEBUG) then
    inform the operator that "Running uil-highlight-button";

    if (button is a uil-navigation-button) then
        config = call upp-get-navigation-button-configuration (button)
    else if (button is a uil-workspace-button) then
        config = call upp-get-workspace-button-configuration (button)
    else
        config = call the procedure named by button-config-procedure (button);

    if (((the object-definition named by TopSAClass exists and button is an instance of the class named by (TopSAClass)) or (the object-definition named by BotSAClass exists and button is an instance of the class named by (BotSAClass))) and (the procedure named by scroll-area-buttons-configuration-proc exists)) then
        call the procedure named by scroll-area-buttons-configuration-proc (button, the symbol highlight)
    else if (config is an item) then 
        begin
        if (DEBUG) then
            inform the operator that "change dark => light & light => dark";
        if (the procedure named by g2-get-item-color-regions-sysproc exists) then 
            begin
            region-array = call the procedure named by g2-get-item-color-regions-sysproc (button);
            for region = each symbol in region-array do
                if region = the symbol uil-button-reversible-color then
                     has-reversible-region = true;
                end;
            delete region-array;
            if has-reversible-region then
                begin
                rotation-state = call the procedure named by g2-get-reflection-and-rotation-sysproc (button);
                case (rotation-state) of 
                    normal:
                        change the color-pattern of button so that uil-button-light-color = the uil-button-dark-color of config, uil-button-dark-color = the uil-button-light-color of config, uil-button-reversible-color = the uil-button-dark-color of config;
                    clockwise-90:
                        change the color-pattern of button so that uil-button-light-color = the uil-button-dark-color of config, uil-button-dark-color = the uil-button-light-color of config, uil-button-reversible-color = the uil-button-light-color of config; 
                    clockwise-180:   {not used yet for tabbed buttons, as of 8-28-96}
                        change the color-pattern of button so that uil-button-light-color = the uil-button-dark-color of config, uil-button-dark-color = the uil-button-light-color of config, uil-button-reversible-color = the uil-button-dark-color of config; 
                    clockwise-270:
                        change the color-pattern of button so that uil-button-light-color = the uil-button-light-color of config, uil-button-dark-color = the uil-button-dark-color of config, uil-button-reversible-color = the uil-button-dark-color of config; 
                    end; 
                end
            else  {if not (has-reversible-region)}
                change the color-pattern of button so that uil-button-light-color = the uil-button-dark-color of config, uil-button-dark-color = the uil-button-light-color of config;
            {wait for .001 seconds;}
            call the procedure named by g2-work-on-drawing-sysproc (the workspace of button);
            end
        else  {system-procedure doesn't exist}
            change the color-pattern of button so that uil-button-light-color = the uil-button-dark-color of config, uil-button-dark-color = the uil-button-light-color of config; 
        end;
end

uil-reset-button (button: class object) 
config: item-or-value;
button-config-procedure: symbol = the symbol uil-get-configuration; 
toggle-button-reset-procedure : symbol = the symbol upp-reset-toggle-button;
configure-scroll-area-buttons-proc: symbol = the symbol upp-configure-scroll-area-buttons;
MI: class module-information;
edit-box-class: symbol = the symbol uil-edit-box;
toggle-button-class: symbol = the symbol uil-text-toggle-button;
IconTBClass: symbol = the symbol uil-icon-toggle-button;
TopSAClass: symbol = the symbol uil-top-scroll-arrow;
BotSAClass: symbol = the symbol uil-bottom-scroll-arrow;
is-nav-button: truth-value = false;
uil-loaded: truth-value = false;
uildefs-loaded: truth-value = false;
rotation-state: symbol;
region-array: class symbol-array;
region: symbol;
has-reversible-region: truth-value = false;
g2-get-reflection-and-rotation-sysproc: symbol = the symbol g2-get-reflection-and-rotation;
g2-get-item-color-regions-sysproc: symbol = the symbol g2-get-item-color-regions;
en: symbol; et: text;
DEBUG: truth-value = false;
begin 

{--  This procedure has been rewritten to be more efficient, but it now depends on a few assumptions being true.  It assumes first that this procedure is in the same module (UILROOT) as selection buttons and navigation buttons, hence it does not need to test for those classes' existence.  It further assumes that the top and bottom scroll arrows are in UIL, and that text and icon toggle buttons are in UILDEFS. --}

    if (DEBUG) then 
        inform the operator that "Running uil-reset-button.";

    if (button does not exist) then
        return;
      
    if (button is a uil-navigation-button) then
        begin
        config = call upp-get-navigation-button-configuration (button);
        is-nav-button = true;
        end
    else
        config = call the procedure named by button-config-procedure (button);

    if (is-nav-button is false) then
        begin
        {-- Figure out what's loaded.  If only uilroot is loaded, or needed, then much of this procedure gets skipped.}
        if (the message-definition named by edit-box-class exists) then
            uil-loaded = true;
        if (the object-definition named by toggle-button-class exists) then
            uildefs-loaded = true; 
        end;    {"if is-nav-button is false"}

    if (DEBUG) then
        inform the operator that "uil-loaded: [uil-loaded], uildefs-loaded: [uildefs-loaded]";

    if (((the class-definition named by TopSAClass exists and button is an instance of the class named by (TopSAClass)) or (the class-definition named by BotSAClass exists and button is an instance of the class named by (BotSAClass))) and (the procedure named by configure-scroll-area-buttons-proc exists)) then
        call the procedure named by configure-scroll-area-buttons-proc (button, the symbol reset)

    else if (uildefs-loaded) and ((button is an instance of the class named by (toggle-button-class)) or (button is an instance of the class named by (IconTBClass))) then
        begin
        call the procedure named by toggle-button-reset-procedure (button, config);
        return;
        end
 
    else
        begin
        if (DEBUG) then
            inform the operator that "configure button based on state";
        if (the state of button is disabled) then 
            begin
            change the color-pattern of button so that uil-button-light-color = the uil-button-disabled-color of config, uil-button-dark-color = the uil-button-disabled-color of config;
            if (button is a uil-selection-button) then
                change the color-pattern of button so that uil-button-face-color = the uil-button-disabled-color of config;
            end
        else
            begin 
            if (button is a uil-selection-button) or ((uildefs-loaded) and (button is an instance of the class named by (IconTBClass))) then
                begin 
                if the toggle-state of button is on then
                    change the color-pattern of button so that uil-button-light-color = the uil-button-light-color of config, uil-button-dark-color = the uil-button-dark-color of config 
                end
            else if (the procedure named by g2-get-item-color-regions-sysproc exists) then
                begin
                region-array = call the procedure named by g2-get-item-color-regions-sysproc (button);
                for region = each symbol in region-array do
                    if region = the symbol uil-button-reversible-color then
                        has-reversible-region = true;
                    end;
                delete region-array;
                if has-reversible-region then
                    begin
                    rotation-state = call the procedure named by g2-get-reflection-and-rotation-sysproc (button);
                    case (rotation-state) of 
                        normal:
                            change the color-pattern of button so that uil-button-light-color = the uil-button-light-color of config, uil-button-dark-color = the uil-button-dark-color of config, uil-button-reversible-color = the uil-button-light-color of config;
                        clockwise-90:
                            change the color-pattern of button so that uil-button-light-color = the uil-button-light-color of config, uil-button-dark-color = the uil-button-dark-color of config, uil-button-reversible-color = the uil-button-dark-color of config; 
                        clockwise-180:   {not used yet for tabbed buttons, as of 8-28-96}
                            change the color-pattern of button so that uil-button-light-color = the uil-button-light-color of config, uil-button-dark-color = the uil-button-dark-color of config, uil-button-reversible-color = the uil-button-light-color of config; 
                        clockwise-270:
                            change the color-pattern of button so that uil-button-light-color = the uil-button-dark-color of config, uil-button-dark-color = the uil-button-light-color of config, uil-button-reversible-color = the uil-button-light-color of config; 
                    end;
                end
            else  {not reversible}
                change the color-pattern of button so that uil-button-light-color = the uil-button-light-color of config, uil-button-dark-color = the uil-button-dark-color of config; 
            end
        else {if not (uildefs-loaded)}
            change the color-pattern of button so that uil-button-light-color = the uil-button-light-color of config, uil-button-dark-color = the uil-button-dark-color of config; 
        end;
    end;  {configure based on state}

if (DEBUG) then
    inform the operator that "Leaving uil-reset-button";
end 
    on error (en, et)
    if (DEBUG) then
        inform the operator that "[en], [et]";
end

guide-is-contained-in(grobj: class item, pail: class guide-garbage-pail) = (truth-value)
  left-bound, right-bound, upper-bound, lower-bound:integer;
  allowance: integer = 10;
begin
  {put this in to handle the multiple garbage pail case}
  pail = the guide-garbage-pail nearest to grobj;

  {Get boundries of the garbage pail}
  left-bound = round(the item-x-position of pail - (the item-width of pail/2)) - allowance; 
  right-bound = round(the item-x-position of pail + (the item-width of pail/2)) + allowance; 
  upper-bound = round(the item-y-position of pail + (the item-height of pail/2)) + allowance; 
  lower-bound = round(the item-y-position of pail - (the item-height of pail/2)) - allowance;
  {check if grobj has been moved into these boundries}
  if ((the item-x-position of grobj > left-bound and the item-x-position of grobj < right-bound) and
     (the item-y-position of grobj > lower-bound and the item-y-position of grobj < upper-bound)) then
    return true
  else
    return false;
end

utl-lift-to-top (itm: class item, W: class ui-client-item)
D: class uil-dialog;
ws: class kb-workspace;
alt-item: class item;
add-dialog-proc: symbol = the symbol upp-add-dialog-to-editable-surfaces-list;
TextPBClass: symbol = the symbol uil-text-pushbutton;
IconPBClass: symbol = the symbol uil-icon-pushbutton;
EBClass: symbol = the symbol uil-edit-box;
DEBUG: truth-value = false;
begin
if (DEBUG) then
    inform the operator that "Running utl-lift-to-top for: [the class of itm]";

    {-- If itm is a dialog, or any object on a dialog, first check to see if the dialog allows being lifted to top --}
    if (itm is a kb-workspace and the item superior to itm exists and the item superior to itm is a uil-dialog) then
        begin
        D = the uil-dialog superior to itm;
        if (the uil-dialog-in-use of D is true) and (the uil-allow-lift-to-top of D is false) then
            begin
            if (DEBUG) then
                inform the operator that "Request ignored";
            return;
            end
        end
    else if (the workspace of itm exists and the item superior to the workspace of itm exists and the item superior to the workspace of itm is a uil-dialog) then
        begin
        D = the uil-dialog superior to the workspace of itm;
        if (the uil-dialog-in-use of D is true) and (the uil-allow-lift-to-top of D is false) then
            begin
            if (DEBUG) then
                inform the operator that "Request ignored";
            return;
            end;
        end;

    if (itm is a kb-workspace) then
        begin
        show itm on W;

        if (the item superior to itm exists and the item superior to itm is a uil-dialog and the uil-dialog-in-use of the uil-dialog superior to itm is true and W is a member of the item list the uil-dialog-window-list of the uil-dialog superior to itm) then
            call the procedure named by add-dialog-proc (the uil-dialog superior to itm, W);
        end
   
    else if (itm is a uil-dialog) then
        begin       
        show the subworkspace of itm on W;

        if (the uil-dialog-in-use of itm is true and W is a member of the item list the uil-dialog-window-list of itm) then
            call the procedure named by add-dialog-proc (itm, W);
        end

    else if (the workspace of itm exists) then
        begin 
        show the workspace of itm on W;    

        if ((not ((the class-definition named by EBClass exists and itm is an instance of the class named by (EBClass)) or (the class-definition named by IconPBClass exists and itm is an instance of the class named by (IconPBClass)) or (the class-definition named by TextPBClass exists and itm is an instance of the class named by (TextPBClass)))) and (the item superior to the workspace of itm exists and the item superior to the workspace of itm is a uil-dialog and the uil-dialog-in-use of the uil-dialog superior to the workspace of itm is true and W is a member of the item list the uil-dialog-window-list of the uil-dialog superior to the workspace of itm)) then
            begin
            call the procedure named by add-dialog-proc (the uil-dialog superior to the workspace of itm, W);
            end;  
        end

    else if (the subworkspace of itm exists) then
        begin
        show the subworkspace of itm on W;
        end

    else if (itm is a connection) then
        begin
        if (there exists an item alt-item connected to itm and the workspace of alt-item exists) then
            begin            
            show the workspace of alt-item on W;  

            if (the item superior to the workspace of itm exists and the item superior to the workspace of itm is a uil-dialog and the uil-dialog-in-use of the uil-dialog superior to the workspace of itm is true and W is a member of the item list the uil-dialog-window-list of the uil-dialog superior to the workspace of itm) then
                call the procedure named by add-dialog-proc (the uil-dialog superior to the workspace of itm, W);          
            end;
        end;

if (DEBUG) then
    inform the operator that "Finished utl-lift-to-top.";
end

uil-select-navigation-button (B: class uil-button, W: class item, drawable: class item)
dlg-or-wksp: class item;
en: symbol; et: text;
uil-highlight-button-proc: symbol = the symbol uil-highlight-button;
uil-reset-button-proc: symbol = the symbol upp-reset-button-internals;
DEBUG: truth-value = false;
begin
if (DEBUG) then
    inform the operator that "Running uil-select-navigation-button.";

    if (B exists) then
        begin
        {show the workspace of B on W;  user didn't want this}
        if the procedure named by uil-highlight-button-proc exists then
            call the procedure named by uil-highlight-button-proc (B); 
        
        if (the procedure named by the uil-handler-method of B exists) then
            begin
            if (the uil-release-button-after-selection of B exists and the uil-release-button-after-selection of B is true) then
                start the procedure named by the uil-handler-method of B (B, W, drawable)
            else
                 call the procedure named by the uil-handler-method of B (B, W, drawable);
            end;

        if the procedure named by uil-reset-button-proc exists then
            call the procedure named by uil-reset-button-proc (B);
        end;
end  
on error (en, et)
    if the procedure named by uil-reset-button-proc exists then
        call the procedure named by uil-reset-button-proc (B);
end

upp-delete-navigation-button-method (b: class uil-navigation-button)
T: item-or-value;
WS, WS2: class kb-workspace;
D: class uil-dialog;
DeleteDialogMethod: symbol = the symbol upp-delete-dialog-method;
Title: symbol = the symbol uil-dialog-title;
title-button-behaviour-enabled: symbol  = the symbol uil-title-button-behaviour-enabled;
HideButton: symbol = the symbol uil-dialog-title-hide-button;
MSG: class message;
begin
{-- Find and remove any dialogs from subworkspace before removing button. This is needed so that copies of master dialogs are properly removed along with the master. --}
    if the subworkspace of b exists then 
        begin
        WS = the subworkspace of b;
        for D = each uil-dialog upon WS do
            call the procedure named by DeleteDialogMethod (D);
            end;
        end;

    make b transient;

    if (the message-definition named by Title exists) and (the object-definition named by HideButton exists) and (b is an instance of the class named by (HideButton)) then 
            begin 
            if the workspace of b exists then
                 begin      
                WS2 = the workspace of b;
                if (there exists an message MSG upon WS2 such that (MSG is an instance of the class named by (Title))) then
                    conclude that the item-or-value that is an attribute of MSG named by title-button-behaviour-enabled = false;
            end;
        go to exit-point;
    end;
    

    if (the uil-label-id of b exists and the uil-label-id of b /= "5.0") then
        begin
        T = call uil-get-label-text (b);
        if (T exists and T is a uil-text) then 
            begin
            make T transient;
            delete T;
            end;
        end;

exit-point:
    delete b;
end

uil-create-navigation-button (id: text, kind: symbol, dest: symbol) = (class uil-grobj)
B:class uil-grobj;
W: class kb-workspace;
HB: class uil-hide-button;
DEBUG: truth-value = false;
begin
  if DEBUG then inform the operator that "Running uil-create-navigation-button id: [id]  kind: [kind]  dest: [dest].";

  case (kind) of 
    HIDE: create a uil-hide-button B;

    HELP: 
      begin
      create a uil-help-button B;
      create a kb-workspace W; 
      HB = call uil-create-navigation-button ("", the symbol HIDE, the symbol none);
      transfer HB to W at (-120, 0);
      change the size of W to minimum;
      make W the subworkspace of B; 
      end;

    GOTO-WORKSPACE: 
      begin
      create a uil-goto-workspace-button B; 
      conclude that the workspace-destination of B = dest;
      create a kb-workspace W;             
      make W the subworkspace of B; 
      end;

     { if (the kb-workspace named by dest exists or the subworkspace of the item named by dest exists) and (dest /= the symbol none) then
          begin
          conclude that the workspace-destination of B = dest;
          end
      else
          begin
          create a kb-workspace W;
          make W the subworkspace of B;
          end;
      end;}

    GOTO-SUPERIOR: 
      create a uil-goto-superior-button B;

    GOTO-NEXT: 
      begin
      {if not (the kb-workspace named by dest exists or the subworkspace of the item named by dest exists) then 
        signal the symbol uil-error, uil-error-navigation-button-invalid-workspace-dest(dest);}

      create a uil-goto-next-button B; 
      conclude that the workspace-destination of B = dest; 
      end;

    GOTO-PREVIOUS: 
      begin
      {if not (the kb-workspace named by dest exists or the subworkspace of the item named by dest exists) then 
       signal the symbol uil-error, uil-error-navigation-button-invalid-workspace-dest(dest);}

      create a uil-goto-previous-button B; 
      conclude that the workspace-destination of B = dest; 
      end;

   { otherwise: 
      signal the symbol uil-error, uil-error-navigation-button-invalid-kind(kind);}
  end;

  conclude that the id of B = id;
  if (uil-use-icon-text-for-button-labels) then
      conclude that the uil-label-id of B = "5.0";
  return B;
end

guide-check-for-trash (grobj: class item, wksp: class kb-workspace) = (truth-value)
  gp: class guide-garbage-pail;
  trash-it: truth-value = false;
  DeleteMethod: symbol = the symbol uil-delete-grobj;
  EBClass: symbol = the symbol uil-edit-box;
  DEBUG: truth-value = false;
begin
if (DEBUG) then
    inform the operator that "Running guide-check-for-trash for: [the class of grobj]";

    if (grobj exists) then
        begin
        {-- This procedure, called by upp-move-button when GUIDE is loaded, checks to see if the grobj has been moved over a garbage pail.  It transfers the grobj into the subworkspace of the garbage pail if this is true. --}

        if (there exists a guide-garbage-pail gp upon wksp) then
            begin
            trash-it = call guide-is-contained-in(grobj, gp);
            wksp = the workspace of grobj;

            if trash-it then 
                begin
                if grobj is a uil-navigation-button then 
                    begin
                    end
                else if (grobj is a uil-text) and (the class-definition named by EBClass exists) and (the item that is the-uil-button-owning-this-text-label grobj exists and the item that is the-uil-button-owning-this-text-label grobj is an instance of the class named by (EBClass)) then
                    grobj = the item that is the-uil-button-owning-this-text-label grobj;

                if (the uil-delete-method of grobj exists and the procedure named by the uil-delete-method of grobj exists) then
                    call the procedure named by the uil-delete-method of grobj (grobj)
                else
                    call the procedure named by DeleteMethod (grobj);
                end;

            if (trash-it and wksp has a name and the name of wksp is g2-guide) then 
                change the size of wksp to minimum;
            end;
        end;
  return trash-it;
end

utl-hide-workspace (B: class uil-button, W: class item, wksp: class kb-workspace) 
WS: class kb-workspace;
D: class item;
reorder-dialog-proc: symbol = the symbol upp-reorder-dialog-in-editable-surfaces-list;
begin 
    if W is a ui-client-item then 
        begin
        if wksp is a kb-workspace then 
            begin
            hide wksp on W;
            end
        else if the workspace of B exists then
            hide the workspace of B on W;
        end;

    if (wksp is a kb-workspace and the item superior to wksp exists and the item superior to wksp is a uil-dialog) then
        begin
        D = the item superior to wksp;
        if (there exists a uil-dialog that is the-uil-parent-dialog-of-this-cascaded-dialog D) then
            call the procedure named by reorder-dialog-proc (D, W, the symbol REFOCUS-ON-PARENT)
        else
            call the procedure named by reorder-dialog-proc (D, W, the symbol REFOCUS-ON-NEXT-IN-LIST);
        end;
end

utl-goto-superior (B: class uil-button , W: class item, WS:class kb-workspace)
OBJ: class item;
DEBUG: truth-value = false;
begin
if (DEBUG) then
    inform the operator that "Running utl-goto-superior";

    if (the item superior to the workspace of B exists) then 
        begin 
        OBJ = the item superior to the workspace of B;
        if (W is a ui-client-item) then 
            begin
            if the uil-hide-this-workspace of B is true then
                hide WS on W;
            show the workspace of OBJ on W;
            end
        else 
            begin 
            if the uil-hide-this-workspace of B is true then 
                hide WS;
            show the workspace of OBJ;
            end;
        end;
end

utl-goto-workspace (B: class uil-button, W: class item, WS: class kb-workspace) 

NewWS: class kb-workspace;
Options: structure = structure (ensure-visible: true);
DEBUG: truth-value = false;

begin

if (DEBUG) then
    post "Running utl-goto-workspace";

if (the uil-hide-this-workspace of B is true) then begin
    if W is a ui-client-item then 
        hide WS on W
    else
        hide WS;
end;

{-- Workspace Destination is a kb-workspace --}
if (the workspace-destination of B exists) and  
  (the item named by the workspace-destination of B exists) and 
  (the item named by the workspace-destination of B is a kb-workspace) then begin
    if (W is a ui-client-item) then
        {### show the item named by the workspace-destination of B on W ###}
        system call g2-ui-show-workspace (the item named by the workspace-destination of B, Options, W) 
    else 
        show the item named by the workspace-destination of B; 
end else if (the workspace-destination of B exists) and (the object named by the workspace-destination of B exists) and 
    (the subworkspace of the object named by the workspace-destination of B exists) then begin
    {-- Workspace Destination is an object --} 
        if (W is a ui-client-item) then
            {### show the subworkspace of the object named by the workspace-destination of B on W ###}
            system call g2-ui-show-workspace (the subworkspace of the object named by the workspace-destination of B, Options, W) 
        else
            show the subworkspace of the object named by the workspace-destination of B; 
end else if (the subworkspace of B exists) and (B is a uil-goto-next-button or B is a uil-goto-previous-button or
    B is a uil-goto-workspace-button) then begin
    {-- Try SWS for goto next, goto previous or goto WS buttons --}
    if (W is a ui-client-item) then
        {###  show the subworkspace of B on W ###}
        system call g2-ui-show-workspace (the subworkspace of B, Options, W)
    else 
        show the subworkspace of B; 
end

{-- Try the item superior to the button for a for goto previous button --} 
{### Remove this since it is inconsistent with the dialog. Use the goto superior instead 
    else if (the item superior to the workspace of B exists) and
         (B is a uil-goto-previous-button) then begin
         call utl-goto-superior (B, W, the workspace of B);
    end
###}
 
else if (the subworkspace of B exists) then begin
{-- Try subworkspace for other buttons --}
    if (W is a ui-client-item) then
        {### show the subworkspace of B on W ###}
        system call g2-ui-show-workspace (the subworkspace of B, Options, W)
    else 
        show the subworkspace of B; 
end else begin
    {-- No match - make a subworkspace for the button and show it --}
    create a kb-workspace NewWS;
    make NewWS the subworkspace of B;
    if (the uil-is-permanent of B exists and the uil-is-permanent of B is true) then
        make NewWS permanent;
    call utl-goto-workspace (B, W, WS);
end;

end

uil-handle-navigation-button-method (button: class uil-navigation-button, W : class item, item-or-wksp: class item)
wksp: class kb-workspace;
highlight-button-proc: symbol = the symbol uil-highlight-button;
reset-button-proc: symbol = the symbol upp-reset-button-internals;
DEBUG: truth-value = false;
begin 
if (DEBUG) or (GUIDE-DEBUG-BUTTON-SELECTION) then
    inform the operator that "Running uil-handle-navigation-button-method for: Label: <[(if the label of button exists then the label of button else "")]>  Id: <[(if the id of button exists then the id of button else "")]>";

    if the procedure named by highlight-button-proc exists then 
        call the procedure named by highlight-button-proc (button);

    if (item-or-wksp is a kb-workspace) then 
        wksp = item-or-wksp
    else
        wksp = the workspace of item-or-wksp;

if (DEBUG) then
    inform the operator that "Wksp = [the class of wksp]";

    if (button is a uil-hide-button) then begin
        if (DEBUG) then
            inform the operator that "Hiding the workspace";
        hide the workspace of button on W {wksp on W} ;
        end 
    else
    if (button is a uil-goto-workspace-button or button is a uil-goto-next-button or button is a uil-goto-previous-button or button is a uil-help-button) then begin
        call utl-goto-workspace (button,W, wksp);
        if (DEBUG) then
            inform the operator that "Case is [the class of button]";
        end
    else if (button is a uil-goto-superior-button) then begin
        call utl-goto-superior (button, W, wksp);
        if (DEBUG) then
            inform the operator that "Case is [the class of button]";
        end;

    if the procedure named by reset-button-proc exists then 
        call the procedure named by reset-button-proc (button);

if (DEBUG) or (GUIDE-DEBUG-BUTTON-SELECTION) then
    inform the operator that "Leaving uil-handle-navigation-button-method for: Label: <[(if the label of button exists then the label of button else "")]>  Id: <[(if the id of button exists then the id of button else "")]>"; 
 end

old-upp-button-mouse-tracking-internals (s1: symbol, W: class g2-window, IV1: item-or-value, IV2: item-or-value, I1: integer, I2: integer, I3: integer, I4: integer)
B : class uil-button;
case-no : symbol;
BtnSelStatus: symbol = the symbol uil-button-selection-status;
nav-button-select : symbol = the symbol uil-select-navigation-button;
reg-button-select: symbol = the symbol uil-select-button;
push-button-class: symbol = the symbol uil-text-pushbutton;
IconPBClass: symbol = the symbol uil-icon-pushbutton;
uildefs-loaded: truth-value = false;
DEBUG: truth-value = false;
DEBUG2: truth-value = false;
en: symbol; et : text;
begin 

if (DEBUG) then
    inform the operator that "Running upp-button-mouse-tracking-internals: <[s1]>";

if IV1 does not exist then
  return;
if IV2 does not exist then 
  return;

if (the object-definition named by push-button-class exists) then 
    uildefs-loaded = true;

{-- ABORT TRACKING --}
if s1 = the symbol abort-tracking then 
    begin
        if (IV1 is a uil-text) and (the uil-button B that is the-uil-button-owning-this-text-label IV1 exists) and (IV1 is the same object as IV2 or the uil-button that is the-uil-button-owning-this-text-label IV1 is the same object as IV2) then 
            begin
                call upp-raise-button (B, s1); 
                call upp-dismiss-short-description-on-window (B, W); 
            end
        else
        if IV1 is a uil-button and (IV1 is the same object as IV2 or IV2 is a uil-text and the uil-button B that is the-uil-button-owning-this-text-label IV2 exists and the uil-button that is the-uil-button-owning-this-text-label IV2 is the same object as IV1) then     
            begin 
                call upp-raise-button (IV1, s1); 
                call upp-dismiss-short-description-on-window (IV1, W); 
            end;
        return;
    end;

{-- ENTER --}
if s1 = the symbol enter then 
    begin
    if DEBUG then
        post "In ENTER processing";
    if IV2 is not an item then
        return;
    if (the state of IV1 exists and the state of IV1 = the symbol disabled) then
        begin
        if (DEBUG) then
            inform the operator that "IV1 exists but is disabled, returning";
        return;
        end;
    if (the state of IV2 exists and the state of IV2  = the symbol disabled) then
        begin
        if (DEBUG) then
            inform the operator that "IV2 exists but is disabled, returning";
        if (IV1 is a uil-button) then
            begin
            call upp-raise-button (IV1, s1);
            call upp-dismiss-short-description-on-window (IV1, W);
            end
        else if (IV1 is a uil-text) then
            begin
            if (the uil-button B that is the-uil-button-owning-this-text-label IV1 exists) then
                begin
                call upp-raise-button (B, s1);
                call upp-dismiss-short-description-on-window (B, W); 
                end;
            end;
        return;
        end;
    if (uildefs-loaded) then
        begin     
        {-- Block button tracking if the dialog is in the process of launching an edit-session --}
        if (DEBUG) then
            begin
            if (the item superior to the workspace of IV1 exists and the item superior to the workspace of IV1 is a uil-dialog) then
                inform the operator that "IV1 dialog status: <[the uil-dialog-status of the uil-dialog superior to the workspace of IV1]>";
            if (the item superior to the workspace of IV2 exists and the item superior to the workspace of IV2 is a uil-dialog) then
                inform the operator that "IV2 dialog status: <[the uil-dialog-status of the uil-dialog superior to the workspace of IV2]>"; 
            end;

        if (the item superior to the workspace of IV1 exists and the item superior to the workspace of IV1 is a uil-dialog and (the uil-dialog-status of the uil-dialog superior to the workspace of IV1 /= the symbol edit-session-in-progress and the uil-dialog-status of the uil-dialog superior to the workspace of IV1 /= the symbol no-edit-session-in-progress-user-disabled)) then 
            begin
            if (DEBUG2) then
                inform the operator that "IV1 mouse-tracking: uil-dialog-status is not edit-session-in-progress <[the uil-dialog-status of the uil-dialog superior to the workspace of IV1]>, returning";
            return;
            end;

        if (the item superior to the workspace of IV2 exists and the item superior to the workspace of IV2 is a uil-dialog and (the uil-dialog-status of the uil-dialog superior to the workspace of IV2 /= the symbol edit-session-in-progress and the uil-dialog-status of the uil-dialog superior to the workspace of IV1 /= the symbol no-edit-session-in-progress-user-disabled)) then 
            begin
            if (DEBUG2) then
                inform the operator that "IV2 mouse-tracking: uil-dialog-status is not edit-session-in-progress <[the uil-dialog-status of the uil-dialog superior to the workspace of IV2]> , returning"; 
            return;
            end;

        {-- Don't let a selected pushbutton get selected --}
        if ((((the class-definition named by IconPBClass exists and IV1 is an instance of the class named by (IconPBClass)) or (the class-definition named by push-button-class exists and IV1 is an instance of the class named by (push-button-class))) and (the item-or-value that is an attribute of IV1 named by BtnSelStatus exists and the item-or-value that is an attribute of IV1 named by BtnSelStatus is selected)) or ((IV1 is a uil-text and there exists a uil-button B that is the-uil-button-owning-this-text-label IV1 ) and ((B is an instance of the class named by (IconPBClass) or B is an instance of the class named by (push-button-class)) and (the item-or-value that is an attribute of B named by BtnSelStatus exists and the item-or-value that is an attribute of B named by BtnSelStatus is selected )))) then
            begin
            if (DEBUG) then
                inform the operator that "leaving upp-button-mouse-tracking, button is already selected";
            return;
            end;
        if (((the class-definition named by IconPBClass exists and IV2 is an instance of the class named by (IconPBClass) or IV2 is an instance of the class named by (push-button-class)) and (the item-or-value that is an attribute of IV2 named by BtnSelStatus exists and the item-or-value that is an attribute of IV2 named by BtnSelStatus is selected )) or ((IV2 is a uil-text and there exists a uil-button B that is the-uil-button-owning-this-text-label IV2) and ((B is an instance of the class named by (IconPBClass) or B is an instance of the class named by (push-button-class)) and (the item-or-value that is an attribute of B named by BtnSelStatus exists and the item-or-value that is an attribute of B named by BtnSelStatus is selected )))) then
            begin
            if (DEBUG) then
                inform the operator that "leaving upp-button-mouse-tracking, button is already selected"; 
            return;
            end;     
        end;

{-- Check for an edit-box that is in the process of launching an editor, but for which the field-mask has not yet been created --}

{-- Case 0 -- entering something other than a button or its label. Resetting. --}
    if IV1 is a uil-button and (IV2 is not a uil-button and IV2 is not a uil-text) then
      begin
        if DEBUG then
            inform the operator that "1. Event:>[s1] / [(if IV1 exists then "[the class of IV1]" else "")]  /  [(if IV2 exists then "[the class of IV2]" else "")]";
        call upp-raise-button (IV1, s1);
        call upp-dismiss-short-description-on-window (IV1, W);
      end
    else
    if IV1 is a uil-text and the uil-button B that is the-uil-button-owning-this-text-label IV1 exists and (IV2 is not a uil-button and IV2 is not a uil-text) then 
      begin
        if DEBUG then
            inform the operator that "2. Event:>[s1] / [(if IV1 exists then "[the class of IV1]" else "")]  /  [(if IV2 exists then "[the class of IV2]" else "")]"; 
        call upp-raise-button (B, s1); 
        call upp-dismiss-short-description-on-window (B, W); 
      end
    else
{-- Case 1 -- Initial entry is a uil-button. --}
    if IV1 is a uil-button and IV1 is the same object as IV2 then     
      begin
        if DEBUG then
            inform the operator  that "3. Event:>[s1] / [(if IV1 exists then "[the class of IV1]" else "")]  /  [(if IV2 exists then "[the class of IV2]" else "")]";
        call upp-lower-button (IV1, s1);
        call upp-post-short-description-on-window (IV1, W); 
      end 
    else

    if IV1 is a uil-button and there exists a uil-text that is the-uil-text-label-of IV1 and the uil-text that is the-uil-text-label-of IV1 is the same object as IV2 then
      begin
        if DEBUG then
            inform the operator that "4. Event:>[s1] / [(if IV1 exists then "[the class of IV1]" else "")]  /  [(if IV2 exists then "[the class of IV2]" else "")]";
        call upp-lower-button (IV1, s1);
        call upp-post-short-description-on-window (IV1, W); 
      end 

    else

    if IV1 is a uil-text and there exists a uil-button B that is the-uil-button-owning-this-text-label IV1 and the uil-button that is the-uil-button-owning-this-text-label IV1 is the same object as IV2 then
      begin
        if DEBUG then
            inform the operator that "5. Event:>[s1] / [(if IV1 exists then "[the class of IV1]" else "")]  /  [(if IV2 exists then "[the class of IV2]" else "")]";
        call upp-lower-button (B, s1);
        call upp-post-short-description-on-window (B, W); 
      end 

    else
    if IV1 is a uil-text and there exists a uil-button B that is the-uil-button-owning-this-text-label IV1 and IV1 is the same object as IV2 then 
      begin
        if DEBUG then
            inform the operator that "6. Event:>[s1] / [(if IV1 exists then "[the class of IV1]" else "")]  /  [(if IV2 exists then "[the class of IV2]" else "")]";
        call upp-lower-button (B, s1);
        call upp-post-short-description-on-window (B, W); 
      end 

    else

{-- Case 2 -- Initial entry is a text label of a uil-button --}
    if IV1 is a uil-text and there exists a uil-button B that is the-uil-button-owning-this-text-label IV1 and IV1 is the same object as IV2 then
      begin 
        if DEBUG then
            inform the operator  that "7. Event:>[s1] / [(if IV1 exists then "[the class of IV1]" else "")]  /  [(if IV2 exists then "[the class of IV2]" else "")]";
        call upp-lower-button (B, s1);
        call upp-post-short-description-on-window (B, W); 
      end 
    else

{-- Case 3 -- Entering something else; i.e. reset the button. --}
    if IV1 is a uil-button then
      begin
        if DEBUG then
            inform the operator  that "8. Event:>[s1] / [(if IV1 exists then "[the class of IV1]" else "")]  /  [(if IV2 exists then "[the class of IV2]" else "")]";
        call upp-raise-button (IV1, s1);
        call upp-dismiss-short-description-on-window (IV1, W); 
      end 
    else

    if IV1 is a uil-text and the uil-button B that is the-uil-button-owning-this-text-label IV1 exists then
      begin
        if DEBUG then
            inform the operator  that "9. Event:>[s1] / [(if IV1 exists then "[the class of IV1]" else "")]  /  [(if IV2 exists then "[the class of IV2]" else "")]";
        call upp-raise-button (B, s1);
        call upp-dismiss-short-description-on-window (B, W); 
      end 
    else       
      return;
end;  {-- END of Event: ENTER tracking --}

{-- STOP-TRACKING --}
if S1 = the symbol stop-tracking then 
  begin
    if IV2 is not an item then
        return;
    if IV1 is not an item then 
        return; 
    if (the state of IV1 exists and the state of IV1 = the symbol disabled) then
        return;
    if (the state of IV2 exists and the state of IV2 = the symbol disabled) then
        return;
    if (uildefs-loaded) then
        begin
        if (((the class-definition named by IconPBClass exists and IV1 is an instance of the class named by (IconPBClass) or IV1 is an instance of the class named by (push-button-class)) and (the item-or-value that is an attribute of IV1 named by BtnSelStatus exists and the item-or-value that is an attribute of IV1 named by BtnSelStatus is selected)) or ((IV1 is a uil-text and there exists a uil-button B that is the-uil-button-owning-this-text-label IV1 ) and ((B is an instance of the class named by (IconPBClass) or B is an instance of the class named by (push-button-class)) and (the item-or-value that is an attribute of B named by BtnSelStatus exists and the item-or-value that is an attribute of B named by BtnSelStatus is selected)))) then
            return;
        if (((the class-definition named by IconPBClass exists and IV2 is an instance of the class named by (IconPBClass) or IV2 is an instance of the class named by (push-button-class)) and (the item-or-value that is an attribute of IV2 named by BtnSelStatus exists and the item-or-value that is an attribute of IV2 named by BtnSelStatus is selected)) or ((IV2 is a uil-text and there exists a uil-button B that is the-uil-button-owning-this-text-label IV2 ) and ((B is an instance of the class named by (IconPBClass) or B is an instance of the class named by (push-button-class)) and (the item-or-value that is an attribute of B named by BtnSelStatus exists and the item-or-value that is an attribute of B named by BtnSelStatus is selected)))) then
            return; 
        end;

    if IV1 is a uil-button and IV1 is the same object as IV2 then
      begin
        if DEBUG then
            inform the operator  that "11. Event:>[s1] / [(if IV1 exists then "[the class of IV1]" else "")]  /  [(if IV2 exists then "[the class of IV2]" else "")]"; 
        if IV1 is a uil-navigation-button then
            call uil-select-navigation-button (IV1, W, the workspace of IV1)
        else
            begin
            if (uildefs-loaded) and (the class-definition named by IconPBClass exists and IV1 is an instance of the class named by (IconPBClass) or IV1 is an instance of the class named by (push-button-class)) then
                begin
                if (the item-or-value that is an attribute of IV1 named by BtnSelStatus exists and the item-or-value that is an attribute of IV1 named by BtnSelStatus = the symbol unselected) then 
                    call the procedure named by reg-button-select (IV1, W, the workspace of IV1 ); 
                end
            else
                call the procedure named by reg-button-select (IV1, W, the workspace of IV1 ); 
            end;

        if IV1 is a uil-navigation-button or ((uildefs-loaded) and (the class-definition named by IconPBClass exists) and (IV1 is an instance of the class named by (push-button-class) or IV1 is an instance of the class named by (IconPBClass))) then
            call upp-raise-button (IV1, s1); 
        call upp-dismiss-short-description-on-window (IV1, W); 
      end 
    else 

    if IV1 is a uil-button and (IV2 is a uil-text and the uil-text TXT that is the-uil-text-label-of IV1 exists and TXT is the same object as IV2) then
      begin
        if DEBUG then
            inform the operator  that "12. Event:>[s1] / [(if IV1 exists then "[the class of IV1]" else "")]  /  [(if IV2 exists then "[the class of IV2]" else "")]"; 
        if IV1 is a uil-navigation-button then
            call uil-select-navigation-button (IV1, W, the workspace of IV1)
        else 
            begin
            if (uildefs-loaded) and (the class-definition named by IconPBClass exists) and (IV1 is an instance of the class named by (IconPBClass) or IV1 is an instance of the class named by (push-button-class)) then
                begin
                if (the item-or-value that is an attribute of IV1 named by BtnSelStatus exists and the item-or-value that is an attribute of IV1 named by BtnSelStatus = the symbol unselected) then
                    call the procedure named by reg-button-select (IV1, W, the workspace of IV1 ); 
                end
            else
                call the procedure named by reg-button-select (IV1, W, the workspace of IV1 ); 
            end;

        if IV1 is a uil-navigation-button or ((uildefs-loaded) and (the class-definition named by IconPBClass exists) and (IV1 is an instance of the class named by (push-button-class) or IV1 is an instance of the class named by (IconPBClass))) then 
            call upp-raise-button (IV1, s1); 
        call upp-dismiss-short-description-on-window (IV1, W); 
      end 
    else 

    if IV1 is a uil-text and 
        the uil-button that is the-uil-button-owning-this-text-label IV1 exists and 
        ((IV1 is the same object as IV2) or (the item that is the-uil-text-label-of IV2 exists and IV1 is the same object as the item that is the-uil-text-label-of IV2)) then
      begin
        if DEBUG then
            inform the operator  that "13. Event:>[s1] / [(if IV1 exists then "[the class of IV1]" else "")]  /  [(if IV2 exists then "[the class of IV2]" else "")]";
        B = the uil-button that is the-uil-button-owning-this-text-label IV1;
        if B is a uil-navigation-button then
            call uil-select-navigation-button (B, W, the workspace of B)
        else 
            begin
            if (uildefs-loaded) and (the class-definition named by IconPBClass exists) and (B is an instance of the class named by (IconPBClass) or B is an instance of the class named by (push-button-class)) then
                begin
                if (the item-or-value that is an attribute of B named by BtnSelStatus exists and the item-or-value that is an attribute of B named by BtnSelStatus = the symbol unselected) then 
                    call the procedure named by reg-button-select (B, W, the workspace of B); 
                end
            else            
                call the procedure named by reg-button-select (B, W, the workspace of B); 
            end;
        {if (IV1 is a uil-navigation-button or IV1 is a uil-text-pushbutton or IV1 is a uil-icon-pushbutton) then 
            call upp-raise-button (IV1, s1);}
        if (B is a uil-navigation-button or (the class-definition named by push-button-class exists and B is an instance of the class named by (push-button-class)) or (the class-definition named by IconPBClass exists and B is an instance of the class named by (IconPBClass))) then 
            call upp-raise-button (B , s1); 
        call upp-dismiss-short-description-on-window (B, W); 
      end
      else

        if IV1 is a uil-button then
          begin
            if DEBUG then
                inform the operator  that "14. Event:>[s1] / [(if IV1 exists then "[the class of IV1]" else "")]  /  [(if IV2 exists then "[the class of IV2]" else "")]";
            call upp-raise-button (IV1, s1); 
            call upp-dismiss-short-description-on-window (IV1, W); 
          end
        else

        if the uil-button B that is the-uil-button-owning-this-text-label IV1 exists then 
          begin
            if DEBUG then
                inform the operator  that "15. Event:>[s1] / [(if IV1 exists then "[the class of IV1]" else "")]  /  [(if IV2 exists then "[the class of IV2]" else "")]";
            call upp-raise-button (B, s1);
            call upp-dismiss-short-description-on-window (B, W); 
          end;

      end;

  end 

on error (en, et)
end

uil-get-uilroot-version () = (float, integer, symbol)
begin
{--
return value 1: the major version number (4.1, 5.0, etc.)
return value 2: the revision number as an integer value
return value 3: the release type (PROTOTYPE, ALPHA, BETA, or RELEASE)
--}
    return 8.4, 3, the symbol RELEASE;
end
